import React, { Component } from 'react';

export default class Donate extends Component {
  constructor(props) {
    super(props);
/*
    this.onChangeUsername = this.onChangeUsername.bind(this);
    this.onChangeMessage = this.onChangeMessage.bind(this);
    this.onChangeAmount = this.onChangeAmount.bind(this);
    this.onChangeMedia_Url = this.onChangeMedia_Url.bind(this);
    this.onChangeStart_Time = this.onChangeStart_Time.bind(this);
*/
    this.state = {
      username: '',
      message: '',
      amount: 0,
      media_url: '',
      start_time: 0
    }
  }


  render() {
    return (
    <div className="container donation-form">
      <h2>Donate</h2>
      <p>Thank you for supporting the stream! All tips are non-refundable. Please only tip if you have the means to do so.</p>
      <hr/>
      <form>
          <div className="form-group">
            <label for="exampleInputEmail1">Your Username</label>
            <input
              required 
              type="text" 
              value={this.state.username} 
              onChange={this.onChangeUsername} 
              placeholder="Username" 
              className="form-control" 
              id="exampleInputEmail1" 
            />
          </div>
          <div className="form-group">
              <label for="exampleInputPassword1">Tip Amount ($)</label>
              <input 
                required 
                type="number" 
                value={this.state.amount} 
                onChange={this.onChangeAmount} 
                placeholder="Your tip amount" 
                className="form-control" 
                id="exampleInputPassword1" 
              />
            </div>
          <div className="form-group">
            <label for="exampleInputPassword1">Message</label>
            <textarea 
              value={this.state.message} 
              onChange={this.onChangeMessage} 
              rows="2" 
              maxlength="255" 
              placeholder="Your message..." 
              className="form-control" 
              id="exampleInputPassword1">
            </textarea>
          </div>
          <div className="form-row">
              <div className="form-group col-md-8">
                  <label for="exampleInputEmail1">Share Media</label>
                  <input 
                    type="text" 
                    value={this.state.media_url} 
                    onChange={this.onChangeMedia_Url} 
                    placeholder="YouTube Video URL..." 
                    className="form-control" 
                    id="exampleInputEmail1" 
                  />
              </div>
              <div className="form-group col-md-4">
                  <label for="exampleInputEmail1">Start Time</label>
                  <input 
                    type="time" 
                    value={this.state.start_time} 
                    onChange={this.onChangeStart_Time} 
                    className="form-control" 
                    id="exampleInputEmail1" 
                  />
              </div>
          </div>
          <button type="submit" className="btn btn-primary">Donate</button>
        </form>
    </div>
    )
  }
}
